import GoogleMapReact from 'google-map-react';
import { Paper, Typography, useMediaQuery } from '@material-ui/core';
import LocationOnOutlinedIcon from '@material-ui/icons/LocationOnOutlined';
import Rating from '@material-ui/lab';

import useStyles from './style';

const Map = () => {
    const classes = useStyles();
    const isMobile = useMediaQuery('(max-width:600px)');

    const coordinates = { lat: 0, lng: 0 };

    return (
        <div className={classes.mapContainer}>
            <GoogleMapReact
                bootstrapURLKeys={{ key: 'AIzaSyBmGzXxqPFOfK0J2TQHqly2dcsiic54wJU' }}
                defaultCenter={coordinates}
                center={coordinates}
                defaultZoom={14}
                margin={[50, 50, 50, 50]}
                options={{/* specify map options here */}}
                onChange={(map) => {/* handle map change event */}}
                onChildClick={(key, childProps) => {/* handle child click event */}}
            >
                {/* Add markers or other map components here */}
            </GoogleMapReact>
        </div>
    );
}

export default Map;
